                    <h2>Email</h2>
                    <input name='email'/>
                    <h2>Password</h2>
                    <input name='password'/>
                    <h2>Account Type</h2>
                    <select id='type'>
                        <option value='0'>Shopper</option>
                        <option value='1'>Seller</option>
                    </select>
                    <br></br>
                    <br></br>
                    <br></br>
                    <button type='submit'>Create Account</button>

                </form>
                <div>
                    <p>Have an account? Sign in!</p>
                    <button onClick={() => {console.log('clicked!')}} id='signinbtn'>Sign In</button>
                </div>
            </div>
        )
    }

    return (
        <div className='loginMain'>
            <div>
                <h1>Login Or Signup</h1>
            </div>
            <br></br>
            {signupForm()}
        </div>
    )

}

export default Login
